import react, { useState, createContext } from "react";

export const context = createContext();

export const ContextProvider = (prop) => {
    const [userData, setUserData] = useState({});

    return (
        <context.ContextProvider
            value={{
                userData,
                setUserData,
            }}
        >
            {props.children}
        </context.ContextProvider>
    );
};
